// Environment


// Components
import { ProfileImages, IntroText, Splitter, NavigationTab, ResumeBox, HardSkills, BackgroundExperience, FeaturedWork, Portafolio } from './components';

import { Parallax, Background } from 'react-parallax';


function App() {
  return (
    <div>
      <Parallax strength={10}>
        <Background>
          <ProfileImages />
        </Background>
      </Parallax>

      <IntroText />
      <Splitter />

      <NavigationTab />
      <Splitter />

      <ResumeBox />
      <Splitter />


      <HardSkills />
      <Splitter />

      <BackgroundExperience />
      <Splitter />

      <FeaturedWork />
      <Splitter />

      <Portafolio />
      <Splitter />


    </div>
  );
}

export default App;
